    import React, {Component} from 'react';

const rightsidebar = ({likecontent,galleryimages,trendsdata}) =>{
  const flexRow = {
    display:"flex",
    flexDirection: "row"  
  };
  const gridCol = {
    display:"grid",
    gridTemplateColumns: "1fr 1fr 1fr"  
  };
  return(
    <div class="rightcolumn">
      <div className="searchForm">
          <form>
            <input className="fa fa-se" placeholder="Search for..." />
          </form>


    {/* <div className="main">
      <div className="form-group has-search">
        <span className="fa fa-search form-control-feedback"></span>
        <input type="text" className="form-control" placeholder="Search"/>
      </div>
    </div> */}


      </div>

      <div  className="card" style={gridCol}>
          {
            galleryimages.map(item => (
              <div style={{margin:"5px"}}>
                  <span ><img src = {item.image} alt=""/></span>
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            likecontent.map(item => (
              <div >
                    <div class="fakeimg"><p><img src={item.image}/>     {item.name}<br/>{item.tweetid}</p></div>      
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            trendsdata.map(item => (
              <div >
                    <div class="fakeimg">
                      <span>Trending in {item.countryname}<br/>    #{item.name}<br/>{item.count}</span></div>      
              </div>
              ))
          }    
      </div>

    </div>
  );
}
export default rightsidebar;
